import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { initializeOpenAiAPI } from './lib/openai-api';

// Initialize window.openai API for ChatGPT-style widgets
if (typeof window !== 'undefined') {
  initializeOpenAiAPI();
}

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
